import React from "react";
import './App.css';
import Header from './Components/header_nav/Header';
import Home from './Components/Home/Home.jsx';
import Message from "./Components/message/Message";
import About_Conference from "./Components/About_conference/About_Conference";
import Callforpapers from "./Components/CallForPapers/Callforpapers";
import Imp_dates from "./Components/ImpDates/Imp_dates";
import Conferenceteam from "./Components/ConferenceTeam/Conferenceteam";
import Welcome from "./Components/Welcome/welcome";
import Contact from './Components/Contact/contact.jsx';
import Venue from './Components/Venue/venue.jsx';
import Footer from "./Components/Footer/footer";
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Submission from './Submission';

function App() {
  return (
    <>
    <main>
    <Router>
          <Header />
      <Routes>
          <Route path="/" exact element={<Home />} />
          <Route path="/Submission" element={<Submission />} />
      </Routes>
    </Router>
      {/* <Message />
      <About_Conference />
      <Callforpapers />
      <Imp_dates />
      <Conferenceteam />
      <Welcome />
      <Contact />
      <Venue /> */}
    </main>
    <footer>
      <Footer />
    </footer>
    </>
  );
}

export default App;
